import React from "react";
import AuthService from "../services/auth-service";
import { Link, useHistory, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import bg from "../assets/bg2.jpg";
import bookingService from "../services/booking.service";
//import images1 from "../images/social.JPG";

let p = localStorage.getItem("username");
let j = localStorage.getItem("jwt");
const Profile = () => {
  const navigate = useNavigate();
  const logOut = () => {
    AuthService.logout();
    navigate("/");
  };
  const AddBooking=()=>{
    bookingService.create();
    navigate("/Addbooking");

 
      
    };
  const [user, setFaculty] = useState([]);
  const init = () => {
    AuthService.getUser(p)
      .then((response) => {
        console.log("Printing faculty data", response.data);
        setFaculty(response.data);
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  useEffect(() => {
    init();
  }, []);
  return (
    <div
      className="profilepage"
      style={{
        backgroundImage: "url(" + bg + ")",
        backgroundSize: "cover",
        height: "42rem",
        width: "95.3rem",
      }}
    >
     
      <div
        // className="profilepage"
        // style={{
        //   backgroundImage: "url(" + bg + ")",
        //   backgroundSize: "cover",
        //   height: "60rem",
        //   width: "100.3rem",
        // }}
      >
        <div> 
        <Link
              style={{ marginLeft: "48rem",background:"green", width:"40%", color:"beige", height:"50%"}}
              className="btn btn-sucess" to="/Addbooking" 
              onClick={() => {
                AddBooking();
              }}

             
            >

              Book Ticket
            </Link>
        </div>
        <div class="profilepage">
          <div class="col-sm-3 sidenav">
            <h2
              style={{
                fontFamily: "monotype corsiva",
                paddingLeft: "95px",
                color: "white",
              }}
            >
              Welcome
            </h2>
            <h3
              style={{
                color: "white",
                paddingLeft: "35px",
                paddingTop: "10px",
              }}
            >
              <strong>{user.username}</strong>
            </h3>
            {/* 
            <p
              class="active"
              style={{
                color: "white",
                paddingLeft: "35px",
              }}
            >
              Dashboard
            </p> */}
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Email:</strong> {user.emailId}
            </p>
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Age:</strong> {user.age}
            </p>
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Gender:</strong> {user.gender}
            </p>
            <br></br>
            <p style={{ color: "white", paddingLeft: "35px" }}>
              <strong>Contact No:</strong> {user.ph_no}
            </p>
            <br></br>
            <button
              style={{ marginLeft: "98px" }}
              className="btn btn-danger ml-2"
              onClick={() => {
                logOut();
              }}
            >
              LOGOUT
            </button>
          </div>
        </div>
        
      </div>
    
     
    </div>
    
  );
};
export default Profile;
